import React from 'react';

const Logo = ({ src, alt = 'Company Logo', className = '', style = {} }) => {
  const defaultLogo = (
    <div className={`default-logo ${className}`} style={style}>
      <svg viewBox="0 0 100 100" width="100%" height="100%">
        <circle cx="50" cy="50" r="45" fill="#0ea5e9" />
        <text
          x="50"
          y="50"
          textAnchor="middle"
          dominantBaseline="central"
          fill="white"
          fontSize="40"
          fontWeight="bold"
        >
          CRM
        </text>
      </svg>
    </div>
  );

  if (!src) {
    return defaultLogo;
  }

  return (
    <img
      src={src}
      alt={alt}
      className={className}
      style={style}
      onError={(e) => {
        e.target.style.display = 'none';
        e.target.parentElement.innerHTML = defaultLogo;
      }}
    />
  );
};

export default Logo;
